import React, { useState } from "react";
import axios from "axios";

function App() {
  const [url, setUrl] = useState("");
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  const checkUrl = async () => {
    if (!url) {
      setError("Please enter a URL.");
      return;
    }

    setLoading(true);
    setError("");
    setResult(null);

    try {
      const res = await axios.get(
        `http://127.0.0.1:8000/predict-url?url=${encodeURIComponent(url)}`
      );
      setResult(res.data);
    } catch (err) {
      setError("Backend not reachable.");
    }

    setLoading(false);
  };

  return (
    <div style={styles.page}>
      <div style={styles.card}>
        <h1 style={styles.title}>Phishing URL Analyzer</h1>

        <p style={styles.subtitle}>
          Machine-learning powered URL safety analysis.
        </p>

        <input
          type="text"
          placeholder="https://example.com"
          value={url}
          onChange={(e) => setUrl(e.target.value)}
          style={styles.input}
        />

        <button onClick={checkUrl} style={styles.button}>
          Analyze URL
        </button>

        {loading && <p style={styles.info}>Running analysisâ€¦</p>}
        {error && <p style={styles.error}>{error}</p>}

        {result && (
          <div style={styles.resultBox}>
            <h2 style={styles.resultTitle}>Scan Results</h2>

            <div style={styles.row}>
              <span>Final Classification:</span>
              <strong
                style={{
                  color:
                    result.final_prediction === "Phishing"
                      ? "#e63946"
                      : "#1d3557",
                }}
              >
                {result.final_prediction}
              </strong>
            </div>

            <div style={styles.row}>
              <span>ML Output:</span>
              <span>{result.ml_prediction}</span>
            </div>

            <div style={styles.row}>
              <span>ML Confidence:</span>
              <span>{(result.ml_probability * 100).toFixed(2)}%</span>
            </div>
          </div>
        )}
      </div>
    </div>
  );
}

// ---------------- PROFESSIONAL CYBERSECURITY COLORS ----------------

const styles = {
  page: {
    minHeight: "100vh",
    background: "#0d0d0d", // Almost black
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    padding: 20,
    color: "#ffffff",
    fontFamily: "'Inter', sans-serif",
  },

  card: {
    width: "100%",
    maxWidth: "520px",
    background: "#1a1a1a",
    padding: "32px",
    borderRadius: "10px",
    boxShadow: "0 4px 20px rgba(0,0,0,0.4)",
    border: "1px solid #2b2d42",
  },

  title: {
    fontSize: "26px",
    fontWeight: "700",
    color: "#e63946", // Bright professional red
    marginBottom: "6px",
  },

  subtitle: {
    fontSize: "14px",
    color: "#bdbdbd",
    marginBottom: "24px",
  },

  input: {
    width: "100%",
    padding: "12px",
    borderRadius: "6px",
    border: "1px solid #444",
    background: "#121212",
    color: "#e0e0e0",
    marginBottom: "16px",
    outline: "none",
    fontSize: "15px",
  },

  button: {
    width: "100%",
    padding: "12px",
    fontSize: "16px",
    marginBottom: "20px",
    background: "#1d3557", // Professional navy blue
    color: "white",
    border: "none",
    borderRadius: "6px",
    fontWeight: "600",
    cursor: "pointer",
    boxShadow: "0 2px 12px rgba(29,53,87,0.4)",
  },

  info: { color: "#8d99ae", textAlign: "center", fontSize: "15px" },
  error: { color: "#ff4d4d", textAlign: "center", fontSize: "15px" },

  resultBox: {
    padding: "20px",
    borderRadius: "8px",
    background: "#111",
    border: "1px solid #333",
  },

  resultTitle: {
    fontSize: "20px",
    fontWeight: "600",
    marginBottom: "14px",
    color: "#4895ef", // Bright blue accent
  },

  row: {
    display: "flex",
    justifyContent: "space-between",
    marginBottom: "10px",
    fontSize: "16px",
    color: "#d6d6d6",
  },
};

export default App;
